import React from "react";
import { Link } from "react-router-dom";

export default () => {
  return (
    <div>
      <Link to="/squares">
        <button>Sq</button>
      </Link>
      <Link to="/squares/new">
        <button>new</button>
      </Link>
    </div>
  );
};
